import React from "react";
import "./Navbar.css";

import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <Link to='/' className="title">Call App</Link>
      <ul>
        <li>
          <Link to="/">About</Link>
        </li>

        <li>
          <Link to="/">About</Link>
        </li>
        <li>
          <Link to="/">About</Link>
        </li>
        <li>
          hi
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
